l="Cuando tu que habilite la configuración, la distribución del teclado anterior se oscurecerá para denotar las nuevas notas graves. Las notas se grabarán con temporización independiente y esto también funciona con dispositivos MIDI. Tenga en cuenta que el desplazamiento de octava de ambos canales utilizados afectará a la altura y la gravedad de los graves/principales en relación entre sí.",xs.noteRecordingPromptLargeText9Label='Las notas grabadas a menudo se superponen de tal manera que una nota termina después de que la siguiente nota ya haya comenzado. En Midbox, estas notas se dividen en varias notas que pueden sonar diferentes cuando se reproducen que cuando se estaban grabando. Para arreglar el sonido, puedes limpiar manualmente las notas en el editor de patrones, o puedes intentar activar el efecto "tipo de transición" en el instrumento y configurarlo en "continuar".',xs.sustainTypePrompt1Label="(A) Acústic",xs.sustainTypePrompt2Label="(B) Brillante",xs.sustainTypePrompt3Label="Tipo Sustain de Cuerda Pulsada",xs.sustainTypePromptLargeText1Label="Este ajuste controla la rapidez con la que decae la vibración de la cuerda punteada.",xs.sustainTypePromptLargeText2Label='A diferencia de la mayoría de las características del sintetizador de instrumentos de Midbox, una cuerda punteada no puede cambiar de frecuencia repentinamente mientras mantiene su decaimiento. Si el tono de un tono cambia repentinamente (por ejemplo, si el tipo de acorde se establece en "arpegio" o el tipo de transición se establece en "continuar"), entonces la cuerda se volverá a tocar y comenzará a decaer desde el principio nuevamente, incluso si las envolventes no se reinician de otra manera.',xs.sustainTypePromptLargeText3Label='Midbox viene con dos diseños de sustain ligeramente diferentes. Puede seleccionar uno aquí y presionar "Confirmar" para confirmarlo.',xs.songPlayer1Label="✎ Editar",xs.songPlayer2Label="⎘ Copiar URL",xs.songPlayer3Label="⤳ Compartir",xs.songPlayer4Label="⇱ Fullscreen"